       },
       purchased_medications: {
         $setUnion: ["$CLAIMS.$**"]
       }
     }
   },
   {
     $unwind: "$purchased_medications"
   },
   {
     $match: {
       "purchased_medications.PRODUCT_NAME": "tramadol hydrochloride 50 MG Oral Tablet"
     }
   },
   {
     $group: {
       _id: "$CLAIM_ID",
       payer: {
         $addToSet: "$purchased_medications.PAYER"
       }
     }
   },
   {
     $project: {
       _id: 0,
       CLAIM_ID: "$_id",
       payer: {
         $arrayElemAt: ["$payer", 0]
       }
     }
   }
 ])

