db.encounters.aggregate([    {
        $match: {
            "PROVIDER_ORG": "NORTH SHORE MEDICAL CENTER INC"
        }
    },
    {
        $unwind: "$DIAGNOSES"
    },
    {
        $unwind: "$MEDICATIONS"
    },
    {
        $unwind: "$SERVICES"
    },
    {
        $unwind: "$PROCEDURES"
    },
    {
        $project: {
            _id: 0,
            ENCOUNTER_ID: 1,
            PROVIDER_ORG: 1,
            DIAGNOSES: 1,
            MEDICATIONS: 1,
            SERVICES: 1,
            PROCEDURES: 1
        }
    },
    {
        $group: {
            _id: {
                ENCOUNTER_ID: "$ENCOUNTER_ID"
            },
            PROVIDER_ORG: { $first: "$PROVIDER_ORG" },
            DIAGNOSES: { $addToSet: "$DIAGNOSES" },
            MEDICATIONS: { $addToSet: "$MEDICATIONS" },
            SERVICES: { $addToSet: "$SERVICES" },
            PROCEDURES: { $addToSet: "$PROCEDURES" }
        }
    },
    {
        $project: {
            _id: 0,
            ENCOUNTER_ID: "$_id.ENCOUNTER_ID",
            PROVIDER_ORG: 1,
            DIAGNOSES: 1,
            MEDICATIONS: 1,
            SERVICES: 1,
            PROCEDURES: 1
